    false,nt"url": null,nt"notes": "Abstract. Seasonal mark-recapture population
    estimates and relative abundance indices for the blunt-nosed  leopard lizard (Gambelia
    silus) were calculated on eight 8-ha study sites at Pixley National Wildlife Refuge,
    u00b7  Tulare County, California. A total of245leopard lizards were captured. Naive
    density ranged from 0.3 to 10.3/  ha. Relative abundance indices ranged from 0.
    7 to 24.6/visit. Based on relative abundance indices (RA), linear  regression equations
    for predictive population estimates (PE) were PE = 3.39 (RA) + 3.56, PE = 3.33 (RA)
    + 0.361,  and PE = 5.14 (RA)- 3.64 in the spring, summer, and fall, respectively.
    Equal numbers of adults and subadults  were found in the spring, but the subadult
    cohort virtually disappeared in the summer and fall. Hatchlings  comprised approximately
    50% of the active population in the fall. The spring population was predominantly
    male  at a 2:1 ratio; the summer sex ratio was essentially equal; and by fall, males
    accounted for only 40% of the active  population. Hatchling sex ratio was (F:M)
    1:1.7.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
